        tutorial_step_select_base_1: "Irridu nibdew bit-tqegħid tal-[Bażi] tiegħek. Dan huwa l-aktar bini importanti tiegħek, u zombies jippruvaw jeqirduh - b'hekk ipproteġiha!",
        tutorial_step_select_base_2: "Agħżel il-bażi mill-pannell tal-bini biex tqiegħedha",
        tutorial_step_place_base: "Kun żgur li tpoġġi l-bażi tiegħek qrib xi [Riżorsi] - f'dan il-każ għażilt pożizzjoni tajba għalik.",
        tutorial_step_explain_zombie_start: "Hekk kif tqiegħed il-bażi tiegħek, iċ-ċirku ta 'matul il-lejl se jibda. [Zombies] se jattakkawk dalwaqt, imma fortunatament dan huwa tutorja, għalhekk se nwaqaf il-ħin għalik!",
        tutorial_step_select_gold_mine_1: "Okay, l-ewwel ser ikollna bżonn xi dħul regolari, għalhekk ejjew npoġġu wkoll [Mina tal-kristall].",
