        tutorial_step_place_first_transporter_2: "Wieħed mill-aspetti ewlenin ta' YORG.io huwa li timmaniġġja n-netwerk tat-trasport tar-riżorsi tiegħek.",
        tutorial_step_select_cannon: "Issa li l-Fabbrika tagħna hija konnessa, aħna finalment lesti biex inpoġġu l-ewwel torri difensiv tagħna - A [Kanun]!",
